libs.content:
find_library(pastix_${pastix_lib}_library
	names ${pastix_lib}
	hints ${pastix_dir}
	path_suffixes lib lib32 lib64)

find_library( glew_glew_library
      names glew glew32
      paths
      $env{glew_root_path}/lib
      ${opengl_library_dir}
    )

find_library(scotch_${scotch_lib}_library
	names ${scotch_lib}
	hints ${scotch_dir}
	path_suffixes lib lib32 lib64)

find_library(ptscotch_${ptscotch_lib}_library
	names ${ptscotch_lib}
	hints ${ptscotch_dir}
	path_suffixes lib lib32 lib64)

find_library(opencl_libraries opencl
	    paths env ld_library_path env opencl_libpath
	    )

find_library(opencl_libraries_mali mali
		paths env ld_library_path env opencl_libpath "/usr/lib64" "$env{cudadir}/lib64"
	)

find_library(
  libr_core_library
  names r r.dll
  hints ${libr_path_hints}
)
